import React, { Component } from 'react';
import { connect } from 'react-redux';

import { cardback, cardfront } from './images';

class Card extends Component {
    render() {
        return(
            <div className={ `part-cards-card${ (!this.props.isCasted) ? "" : " casted rotated"  }` }>
            <div className="part-cards-card-front">
                <img
                    src={ cardback }
                    className="part-cards-card-front-image"
                    alt="card"
                />          
            </div>
            <div className="part-cards-card-back">
                <img
                src={ cardfront }
                className="part-cards-card-back-image"
                alt="card"
                />
                <span className="part-cards-card-back-mark">15</span>
            </div>
            </div>
        );
    }
}

const mapStateToProps = ({ global }) => ({
    global
});

export default connect(
    mapStateToProps
)(Card);
